import Form from "./Form";
import Tasks from "./Tasks";
import HeadlineButtons from "./HeadlineButtons";
import Section from "./Section";
import Header from "./Header";

const tasks = [
  { id: 1, content: "robic reacta", done: false },
  { id: 2, content: "grac w gierki", done: false },
];

const hideDoneTasks = [];

function App() {
  return (
    <main className="main">
      <header>
        <h1>
          Lista zadań
        </h1>
      </header>
      <Section
        title="Dodaj nowe zadanie"
        body={<Form key={tasks.id} />}
      />

      <Section
        title="Lista zadań"
        body={<HeadlineButtons key={tasks.id} tasks={tasks} hideDoneTasks={hideDoneTasks} />}
        extraHeaderContent={<Tasks key={tasks.id} tasks={tasks} hideDoneTasks={hideDoneTasks} />}
      />
    </main>
  );
}

export default App;
